/**x座標での長さをy座標での長さに変換する */
const x2y = function (x) {
	return x / ep.aspectRatio;
}
/**y座標での長さをx座標での長さに変換する */
const y2x = function (y) {
	return y * ep.aspectRatio;
}

/** ロードを担当する． */
const loader = (function () {
	//soundなど，特化したmanagerが他にいるならば，その分野のロードはそちらに任せる．
	/**一番最初のロード． */
	function _initLoad() {
		//load stageの末尾で消すので，初期化時は消さなくてもいい．
		document.getElementById("bb_loading").setAttribute("visibility", "visible");

		const svgElements = document.getElementsByTagNameNS("http://www.w3.org/2000/svg", "svg");
		for (const svgElem of svgElements) {
			svgElem.setAttribute("viewBox", `0,0,1000,${ep.aspectRatio * 1000}`);
		}

		const nRow = ep.nRow;
		const nCol = ep.nCol;
		const blockW = 1 / nCol * 100;//%
		const blockH = x2y(blockW);
		const foreMaskElem = document.getElementById("bb_foregroundMask");
		const glinesElem = document.getElementById("bb_g-lines");
		for (let r = 0; r < nRow; r++) {
			for (let c = 0; c < nCol; c++) {
				const eachMaskElem = document.createElementNS("http://www.w3.org/2000/svg", "rect");
				eachMaskElem.setAttribute("x", `${c * blockW}%`);
				eachMaskElem.setAttribute("y", `${r * blockH}%`);
				eachMaskElem.setAttribute("width", `${blockW}%`);
				eachMaskElem.setAttribute("height", `${blockH}%`);
				eachMaskElem.setAttribute("id", `bb_mask${r},${c}`);
				foreMaskElem.appendChild(eachMaskElem);

				const eachLineElem = document.createElementNS("http://www.w3.org/2000/svg", "rect");
				eachLineElem.setAttribute("x", `${c * blockW}%`);
				eachLineElem.setAttribute("y", `${r * blockH}%`);
				eachLineElem.setAttribute("width", `${blockW}%`);
				eachLineElem.setAttribute("height", `${blockH}%`);
				eachLineElem.setAttribute("id", `bb_line${r},${c}`);
				glinesElem.appendChild(eachLineElem);
			}
		}

		const padElem = document.getElementById("bb_pad");
		padElem.setAttribute("y", `${ep.padY * 100}%`);
		padElem.setAttribute("width", `${ep.padW * 100}%`);
		padElem.setAttribute("height", `${ep.padH * 100}%`);

		const padCoreElem = document.getElementById("bb_pad_core");
		padCoreElem.setAttribute("x", `${(0.5 - ep.padCoreW / 2) * 100}%`);
		padCoreElem.setAttribute("width", `${ep.padCoreW * 100}%`);

		// 下から15pt
		const lastRowY = 1000 * ep.aspectRatio - 15;
		document.getElementById("bb_text_stage")
			.setAttribute("y", `${lastRowY}`);
		document.getElementById("bb_text_percent")
			.setAttribute("y", `${lastRowY}`);
		document.getElementById("bb_text_stock")
			.setAttribute("y", `${lastRowY}`);

		document.getElementById("bb_item_name")
			.setAttribute("y", `${1000 * ep.aspectRatio - 70}`);
		const gauge = document.getElementById("bb_item_gauge");
		gauge.setAttribute("y1", `${1000 * ep.aspectRatio - 85}`);
		gauge.setAttribute("y1", `${1000 * ep.aspectRatio - 85}`);


		sm.loadAsync();
	}

	/**各ステージに必要な画像などをロードする．
	 * @param {Number} stageNum
	 * @param {Function} finishAction
	 */
	function _loadStage(stageNum, finishAction) {
		const loadText = document.getElementById("bb_loading");
		loadText.setAttribute("visibility", "visible");

		// 実行される順序がややこしいのでコメントしてある．
		const foreIm = document.getElementById("bb_foreground");// 1
		foreIm.onload = () => {
			const backIm = document.getElementById("bb_background");// 3
			backIm.onload = () => {
				loadText.setAttribute("visibility", "hidden");// 5
				finishAction(); //6
			}
			backIm.setAttribute("href", ep.backHrefs[stageNum]);// 4
		}
		foreIm.setAttribute("href", ep.foreHrefs[stageNum]);// 2
	}
	return {
		initLoad: _initLoad,
		loadStage: _loadStage,
	}
})();



/** SvgManager
 *  SVGとのインターフェイスの役割を担う．
 *  Ballなど特殊なギミックを含むものは別のクラスに任せる．
 *  なにかと使うのでファイルの最初の方に配置する．*/
const svgm = (function () {
	//private
	const _svgElem = document.getElementById("bb2021");
	const _percentTextElem = document.getElementById("bb_text_percent");
	//public
	return {
		setStockText(x) {
			document.getElementById("bb_text_stock").textContent = `Stock ${x}`;
		},
		setStageText(x) {
			document.getElementById("bb_text_stage").textContent = `Stage ${x}/${ep.nStage}`;
		},
		setPercentText(x) {
			_percentTextElem.textContent = `${x}% / ${ep.requirePercent}%`;
		},
		svgBump(dir) {
			if (dir === undefined) {
				dir = cointoss() ?
					cointoss() ? "left" : "right" :
					cointoss() ? "up" : "down";
			}
			_svgElem.setAttribute("class", `bump-${dir}`);
		},
		//row行col列のブロックを見えなくする．
		hideBlock(row, col) {
			document.getElementById(`bb_mask${row},${col}`).setAttribute("class", "hide_mask");
			document.getElementById(`bb_line${row},${col}`).setAttribute("class", "hide_line");
		},
		//row行col列のブロックを見えるようにする．
		showBlock(row, col) {
			document.getElementById(`bb_mask${row},${col}`).removeAttribute("class");
			document.getElementById(`bb_line${row},${col}`).removeAttribute("class");
			//classがついてなくてもエラーはでない．
		},
		showFailed() {
			document.getElementById("bb_failed").setAttribute("visibility", "visible");
		},
		hideFailed() {
			document.getElementById("bb_failed").setAttribute("visibility", "hidden");
		},
		showStageClear() {
			document.getElementById("bb_cleartext").textContent = "Stage clear!";
		},
		hideStageClear() {
			document.getElementById("bb_cleartext").textContent = "";
		},
		showGameClear() {
			document.getElementById("bb_cleartext").textContent = "Game clear!";
			document.getElementById("bb_clearnavi").setAttribute("visibility", "visible");
		},
	}
})();



