// 貫通弾
// 受け取った瞬間から球が貫通弾になり，時間制限まで貫通弾の状態を維持する．
// 時間制限を超えても貫通状態は維持されるが，パドルによって貫通弾ではなくなる．
class PiercingItem extends DropItem_Continuous {
	static name = "Piercing";
	static #tLim = 3000;//[ms]
	constructor(x, y) {
		super(x, y);
		this.svgElement.setAttribute("href", "#bb_piercing_icon");
		super.isInstant = false;
	}
	activate() {
		uim.usingItem = new UsingItem({
			name: PiercingItem.name,
			tLim: PiercingItem.#tLim,
			firstAction() {
				bm.gotoHead();
				while (bm.nowNode !== null) {
					bm.nowNode.mode = Ball.modeTypes.penetration;
					bm.gotoNext();
				}
			},
		});
	}
}

// ボール増加
// ボールの数がN倍になる
// ボール数の制限はballManager側で行う
class ManyItem extends DropItem_Instant {
	static #N = 3;
	constructor(x, y) {
		super(x, y);
		this.svgElement.setAttribute("href", "#bb_many_icon");
	}
	activate() {
		bm.gotoHead();
		while (bm.nowNode !== null) {
			if (!bm.canAdd) return;
			let v = length(bm.nowNode.vx, y2x(bm.nowNode.vy));//in x axis
			for (let i = 0; i < ManyItem.#N - 1; i++) {
				//theta = -pi/2~pi/2 (*AngleLim)
				const theta = (Math.random() - 0.5) * Math.PI * Ball.AngleLim;
				//dx = -1~1 (*limit)
				const dx = Math.sin(theta);//attention, sin=x
				//dy = 0~1~0 (*limit) (*random+-)
				const dy = (Math.random() < 0.5 ? 1 : -1)
					* x2y(Math.cos(theta));
				const newBall = new Ball(bm.nowNode.x, bm.nowNode.y, v * dx, v * dy);
				if (uim.usingItem.name === BigballItem.name) {
					newBall.setSvgR(bm.nowNode.svgr);
				}
				bm.add(newBall);
			}
			bm.gotoNext();
		}
	}
}

