class BlinkItem extends DropItem_Continuous {
	static name = "Blink";
	static #tLim = 7000;//[ms]
	static #visibleTime = 1500;
	static #hiddenTime = 800;
	static #T = BlinkItem.#visibleTime + BlinkItem.#hiddenTime;
	static #svgElem = document.getElementById("bb_balls");
	constructor(x, y) {
		super(x, y);
		this.svgElement.setAttribute("href", "#bb_blink_icon");
	}
	activate() {
		uim.usingItem = new UsingItem({
			name: BlinkItem.name,
			tLim: BlinkItem.#tLim,
			tick(dt, sumT) {
				const modT = sumT % BlinkItem.#T;
				const visible = modT <= BlinkItem.#visibleTime;
				BlinkItem.#svgElem.setAttribute("opacity", visible ? "1" : "0");
			},
			destruct() {
				BlinkItem.#svgElem.removeAttribute("opacity");
			}
		})
	}
}


class BigballItem extends DropItem_Continuous {
	static name = "Big ball";
	static #tLim = 3000;//[ms]
	static #bigSvgR = 0.14;
	constructor(x, y) {
		super(x, y);
		this.svgElement.setAttribute("href", "#bb_bigball_icon");
	}
	activate() {
		uim.usingItem = new UsingItem({
			name: BigballItem.name,
			tLim: BigballItem.#tLim,
			firstAction() {
				bm.gotoHead();
				while (bm.nowNode !== null) {
					bm.nowNode.setSvgR(BigballItem.#bigSvgR);
					bm.gotoNext();
				}
				bm.gotoHead();
				while (bm.nowNode !== null) {
					let b = bm.nowNode;//ball
					//leftなどが乗っているブロックのインデックス
					let xBegin = Math.floor(b.left * ep.nCol);
					let xEnd = Math.floor(b.right * ep.nCol);
					let yBegin = Math.floor(b.top / ep.bBound * ep.nRow);
					let yEnd = Math.floor(b.bottom / ep.bBound * ep.nRow);
					xBegin = clamp(xBegin, 0, ep.nCol - 1);
					yBegin = clamp(yBegin, 0, ep.nRow - 1);
					xEnd = clamp(xEnd, 0, ep.nCol - 1);
					yEnd = clamp(yEnd, 0, ep.nRow - 1);
					for (let x = xBegin; x <= xEnd; x++) {//<=attention!
						for (let y = yBegin; y <= yEnd; y++) {
							game.hitBlock(y, x, false);
						}
					}
					bm.gotoNext();
				}
			},
			destruct() {
				bm.gotoHead();
				while (bm.nowNode !== null) {
					bm.nowNode.setSvgR();
					bm.gotoNext();
				}
			}
		})
	}
}

class Ball {
	//static
	static #gElem = document.getElementById("bb_balls");
	static #defSvgR = ep.defBallR;
	static #defVx = ep.v0 * Math.SQRT1_2;//[/msec]
	static #defVy = x2y(-ep.v0 * Math.SQRT1_2);
	static #dv = ep.dv;
	static #maxV = ep.maxV;
	// ボールの進行角度を(1/2+-AngleLim)*pi（下側も同様）に制限する
	static AngleLim = 0.8;
	static modeTypes = {
		normal: "normal",
		penetration: "penetration"
	}

	//public
	x;
	y;
	static vScale = 1;
	#vx;
	#vy;
	get vx() { return this.#vx * Ball.vScale; }
	get vy() { return this.#vy * Ball.vScale; }
	set vx(value) { this.#vx = value / Ball.vScale; }
	set vy(value) { this.#vy = value / Ball.vScale; }
	prev;//BallManager uses these
	next;

	//private
	#svgr
	#xr;
	#yr;
	#mode = Ball.modeTypes.normal;
	#svgElem;
	constructor(x, y, vx = Ball.#defVx * Ball.vScale, vy = Ball.#defVy * Ball.vScale) {
		this.#svgElem = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
		this.setSvgR();
		this.x = x ?? 0.5;
		this.y = y ?? pad.top - this.yr;
		this.vx = vx;
		this.vy = vy;
		Ball.#gElem.appendChild(this.#svgElem);
		this.moveSvg();
	}
	destruct() { this.#svgElem.remove(); }
	moveSvg() {
		this.#svgElem.style.transform = `translate(${this.x * 100}%, ${this.y * 100}%)`;
	}
	#atVLimit = false;
	accelerate() {
		if (this.#atVLimit) return;
		const vy_x = y2x(this.vy);
		const nowV = length(this.vx, vy_x);
		let newV = nowV + Ball.#dv;
		if (newV > Ball.#maxV) {
			this.#atVLimit = true;
			newV = Ball.#maxV;
		}
		this.vx = newV / nowV * this.vx;
		this.vy = newV / nowV * x2y(vy_x);
	}
	get mode() { return this.#mode; }
	set mode(modeName) {
		if (this.#mode === modeName) return;
		this.#mode = modeName;
		if (this.#mode === Ball.modeTypes.penetration) {
			this.#svgElem.setAttribute("class", "penetration");
		} else {
			this.#svgElem.removeAttribute("class");
		}
	}

	/**ボールの半径を設定する．引数がない場合デフォルト値にする．
	 * @param {number} newR 設定する半径(svg形式, 実数)*/
	setSvgR(newR = Ball.#defSvgR) {
		this.#svgr = newR;
		//仕様: https://triple-underscore.github.io/svg-coords-ja.html#_normalized-diagonal
		//xの基準横幅が1，yの基準縦幅がaspectRatioだとする．
		//r(%)の基準長さlは
		const l = Math.sqrt(1 ** 2 + ep.aspectRatio ** 2) / Math.SQRT2;
		this.#xr = l * this.#svgr / 1;
		this.#yr = l * this.#svgr / ep.aspectRatio;
		this.#svgElem.setAttribute("r", `${this.#svgr * 100}%`);
	}
	get svgr() { return this.#svgr; }
	get xr() { return this.#xr; }
	get yr() { return this.#yr; }
	get left() { return this.x - this.xr; }
	get right() { return this.x + this.xr; }
	get top() { return this.y - this.yr; }
	get bottom() { return this.y + this.yr; }
	//ヒットしたときにエフェクトを発生させる．
	causeEffect() { return this.#mode !== Ball.modeTypes.normal; }
	get inViewbox() { return this.top < 1; }
}





/**BallManager */
const bm = (function () {
	let _head = null;
	let _nowNode = null;
	const _limitNum = 1000;
	let _numBall = 0;
	/**ノードを削除する
	 * @param {Ball} target 削除対象のノード*/
	function _delete(target) {
		target.destruct();
		if (target.prev === null && target.next === null) {
			_head = null;
		} else if (target.prev === null) {
			_head = target.next;
			target.next.prev = null;
		} else if (target.next === null) {
			target.prev.next = target.next;
		} else {
			target.prev.next = target.next;
			target.next.prev = target.prev;
		}
		_numBall--;
	}
	//public
	return {
		get canAdd() { return _numBall < _limitNum; },
		//先頭にnewBallを追加する
		/**先頭にノードを追加する
		 * @param {Ball} newBall 追加対象*/
		add(newBall) {
			_numBall++;
			newBall.next = _head;
			newBall.prev = null;
			_head = newBall;
			if (newBall.next !== null) newBall.next.prev = newBall;
		},
		gotoHead() { _nowNode = _head; },
		gotoNext() { if (_nowNode !== null) _nowNode = _nowNode.next; },
		get nowNode() { return _nowNode; },
		moveSvgAll() {
			let target = _head;
			while (target !== null) {
				target.moveSvg();
				target = target.next;
			}
		},
		deleteAll() {
			let target = _head;
			while (target !== null) {
				target.destruct();
				target = target.next;
			}
			_head = null;
			_numBall = 0;
		},
		sweep() {
			let target = _head;
			while (target !== null) {
				if (!target.inViewbox) {
					_delete(target);
				}
				target = target.next;
			}
		},
		get noBall() { return _head === null; }
	}
})();

const pad = (function () {
	//private
	let _x = 0.5;
	/**前のフレームでのxの値．side衝突判定で使用 */
	let _beforeX = 0.5;
	const _svgElem = document.getElementById("bb_pad");
	const _gameAreaElem = document.getElementById("bb2021");
	function _defWidth() { return ep.padW; }
	let _width = _defWidth();
	//public
	return {
		set x(value) { _x = clamp(value, 0, 1); },
		get x() { return _x; },
		setXByEventX(inX) { this.x = inX / _gameAreaElem.clientWidth; },
		moveSvg() {
			_svgElem.style.transform = `translate(${this.left * 100}%)`;
		},
		causeHitEffect() {
			_svgElem.setAttribute("class", "hit_pad");
		},
		/**現在のxの値を_beforeX(前回のフレームのx)として記録する */
		recordBeforeX() { _beforeX = _x; },
		get width() { return _width; },
		set width(value) {
			if (value === _width) return;
			_width = value;
			_svgElem.setAttribute("width", `${_width * 100}%`);
			this.moveSvg();
		},
		setByDefWidth() { this.width = _defWidth(); },
		get left() { return _x - this.width / 2; },
		get right() { return _x + this.width / 2; },
		get beforeLeft() { return _beforeX - this.width / 2; },
		get beforeRight() { return _beforeX + this.width / 2; },
		get top() { return ep.padY; },
		get bottom() { return this.top + ep.padH; },
		/**ゲーム領域に対するパドル中心部の横幅 */
		get coreWidth() { return ep.padCoreW * this.width; }
	}
})();

/**UsingItemManager
 * 現在使っているアイテムを管理するオブジェクト*/
const uim = (function () {
	let _usingItem = UsingItem.GenerateNoItem();
	let _gauge = 1;
	const gaugeElem = document.getElementById("bb_item_gauge");
	gaugeElem.style.transformOrigin = gaugeElem.x1.baseVal.valueAsString;

	return {
		get usingItem() { return _usingItem; },
		set usingItem(item) {
			_usingItem.destruct();
			_usingItem = item;
			_usingItem.firstAction();
			this.gauge = 1;
			document.getElementById("bb_item_name").textContent = _usingItem.name;
		},
		/**@param {number} value */
		set gauge(value) {
			if (_gauge === value) return;
			_gauge = value;
			gaugeElem.style.transform = `scaleX(${_gauge})`;
			if (_gauge < 0) this.setNoItem();
		},
		setNoItem() {
			this.usingItem = UsingItem.GenerateNoItem();
		},
		/**@param {number} dt */
		tick(dt) {
			const nowGauge = _usingItem.tick(dt);
			this.gauge = nowGauge;
		}
	}
})();

/**DropItemManager
 * 落ちてくるアイテムを管理するオブジェクト*/
const dim = (function () {
	// null=>node=>node=>...=>null
	//private
	/** @type{DropItem} */
	let _head = null;
	/**先頭にノードを追加する
	 * @param {DropItem} newNode 追加対象*/
	function _add(newNode) {
		// newNodeの前後を指定
		newNode.next = _head;
		newNode.prev = null;
		// _headの指示先を変更
		_head = newNode;
		// 押し下げられたノードのprev変更
		if (newNode.next !== null) newNode.next.prev = newNode;
	}
	/**ノードを削除する
	 * @param {DropItem} target 削除対象*/
	function _delete(target) {
		target.destruct();
		if (target.prev === null && target.next === null) {
			//target is 1st node ans last node
			_head = null;
		} else if (target.prev === null) {
			//target is 1st node
			_head = target.next;
			target.next.prev = null;
		} else if (target.next === null) {
			//target is last node
			target.prev.next = target.next;
		} else {
			target.prev.next = target.next;
			target.next.prev = target.prev;
		}
	}
	//public
	return {
		addNewItem(x, y) {
			if (Math.random() * 100 > ep.itemPopPercent) return;
			const newItem = dig.GetNewItem(x, y);
			_add(newItem);
		},
		/**全てのDropItemを下に進めて衝突判定を行う
		 * dt[ms]以内に衝突するかどうかを判定する．
		 * @param {object} pad パドル
		 * @param {number} dt 経過時間[ms]*/
		collision(pad, dt) {
			// 最終的には一番上にあるものと衝突する
			let minY = 1;
			let hitTarget = null;
			let target = _head;
			while (target !== null) {
				if (target.isHit(pad, dt)) {
					if (target.isInstant) {
						target.activate();
						sm.callItemSe();
					} else {
						if (target.y < minY) {
							minY = target.y;
							hitTarget = target;
						}
					}
					_delete(target);
				}
				target.step(dt);
				if (!target.inViewbox) _delete(target);
				target = target.next;
			}
			if (hitTarget !== null) {
				hitTarget.activate();
				sm.callItemSe();
			}
		},
		deleteAll() {
			let target = _head;
			while (target !== null) {
				target.destruct();
				target = target.next;
			}
			_head = null;
		}
	}
})();


/**DropItemGenerator
 * アイテムの発生割合を管理する
 */
const dig = (function () {
	//ep.itemWeightsのフィールド名はC#側との折衝用で、JSではここ以外で気にしなくてよい。
	const _items = [
		{ ratio: 0, constructor: OneupItem, weight: ep.itemWeights.Oneup },
		{ ratio: 0, constructor: PiercingItem, weight: ep.itemWeights.Piercing },
		{ ratio: 0, constructor: ManyItem, weight: ep.itemWeights.Many },
		{ ratio: 0, constructor: WideItem, weight: ep.itemWeights.Wide },
		{ ratio: 0, constructor: ShortItem, weight: ep.itemWeights.Short },
		{ ratio: 0, constructor: BlinkItem, weight: ep.itemWeights.Blink },
		{ ratio: 0, constructor: BigballItem, weight: ep.itemWeights.Big },
	];
	(function () {
		let sum = 0;
		for (let i = 0; i < _items.length; i++) {
			sum += _items[i].weight;
		}
		let sumW = 0;
		for (let i = 0; i < _items.length; i++) {
			sumW += _items[i].weight;
			_items[i].ratio = sumW / sum;
		}
	})();
	return {
		/**新しくドロップアイテムを生成する */
		GetNewItem(x, y) {
			const rand = Math.random();
			for (let i = 0; i < _items.length; i++) {
				if (rand <= _items[i].ratio) {
					return new _items[i].constructor(x, y);
				}
			}
			return new _items[_items.length - 1].constructor(x, y);
		}
	}
})();

/**"SoundManager" */
const sm = (function () {
	const _audios = [
		{ ctx: new AudioContext(), buffer: null, src: ep.bgmSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.itemSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.padSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.wallSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.holdoffSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.failSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.stageClearSeSrc, loaded: false },
		{ ctx: new AudioContext(), buffer: null, src: ep.gameClearSeSrc, loaded: false },
	];
	//音を流すのはアクションがあったとき以降じゃないといけないらしい
	/**BGMの再生開始と各SEの起動作業を行う */
	function _activate() {
		for (let i = 0; i < _audios.length; i++) {
			if (_audios[i].src === "") continue;
			if (!_audios[i].loaded) return;
		}
		for (let i = 0; i < _audios.length; i++) {
			if (!_audios[i].loaded) continue;
			const source = _audios[i].ctx.createBufferSource();
			source.buffer = _audios[i].buffer;
			source.connect(_audios[i].ctx.destination);
			if (i === 0) source.loop = true;
			source.start(0);
			if (i !== 0) source.stop(0);
		}
		window.removeEventListener("touchstart", _activate);
		window.removeEventListener("click", _activate);
	}
	/**SEを再生する．
	 * @param {number} i _audiosのインデックス*/
	function _playSe(i) {
		if (_audios[i].ctx === null) return;
		const source = _audios[i].ctx.createBufferSource();
		source.buffer = _audios[i].buffer;
		source.connect(_audios[i].ctx.destination);
		source.start(0);
	}
	return {
		/**
		 * SEのロードを開始する。
		 */
		async loadAsync() {
			for (let i = 0; i < _audios.length; i++) {
				if (_audios[i].src === "") {
					_audios[i].ctx = null;
					continue;
				}
				const arrayBuffer = await fetch(_audios[i].src)
					.then(response => response.arrayBuffer());
				_audios[i].ctx.decodeAudioData(arrayBuffer, (buffer) => {
					_audios[i].buffer = buffer;
					_audios[i].loaded = true;
				});
			}

			window.addEventListener("touchstart", _activate);
			window.addEventListener("click", _activate);
		},
		callItemSe() { _playSe(1); },
		callPadSe() { _playSe(2); },
		callWallSe() { _playSe(3); },
		callHoldoffSe() { _playSe(4); },
		callFailSe() { _playSe(5); },
		callStageClearSe() { _playSe(6); },
		callGameClearSe() { _playSe(7); },
	}
})();


// 初期化時の流れ
// 1. DOMContentLoadedに登録した関数が呼ばれる．
//    =>内部でgame.initialize()を呼ぶ．
// 2. game.initialize()が呼ばれる．
// 3. game._initStage()が呼ばれる．
//    =>foreImのhrefがsetされる．
//    =>foreImのonloadがbackImのhrefをsetする．
//    =>backImのonloadがrequestAnimationFrameを呼ぶ．


document.addEventListener("DOMContentLoaded", () => {
	const target = document.getElementById("bb2021");
	//呼び出される関数がpreventDefaultを呼ぶならfalse
	target.addEventListener("mousemove", mouseMoveEvent, { passive: true });
	target.addEventListener("touchmove", touchEvent, { passive: false });
	target.addEventListener("touchstart", touchEvent, { passive: false });
	target.addEventListener("animationend", animationEndEvent, { passive: true });
	target.addEventListener("click", clickEvent, { passive: true });

	game.initialize();
});


// ==== EventListenerに登録する関数 ====
const mouseMoveEvent = function (e) {
	pad.setXByEventX(e.offsetX);
}
const touchEvent = function (e) {
	if (game.holding) game.holding = false;
	e.preventDefault();
	let x = 0;
	for (let i = 0; i < e.targetTouches.length; i++) {
		x = x + e.targetTouches[i].pageX;
	}
	x = x / e.targetTouches.length
	pad.setXByEventX(x);
}
const animationEndEvent = function (e) {
	e.target.removeAttribute("class");
}
const clickEvent = function () {
	if (game.holding) game.holding = false;
}


/**ゲームの流れを動かすオブジェクト */
const game = (function () {
	//ゲームごとに初期化する変数
	let _stageNum = -1;
	let _stock = ep.defStock;
	//ステージごとに初期化する変数
	let _stage;
	let _nBreak;
	let _holding = true;
	//ループごとに変化する変数
	let _beforeT;

	function _initialize() {
		loader.initLoad();
		svgm.setStockText(_stock);
		_initStage();
	}

	function _initStage() {
		_stageNum++;
		svgm.setStageText(_stageNum + 1);
		_nBreak = 0;
		svgm.setPercentText(Math.floor(_nBreak * 100 / ep.nBlocks[_stageNum]));

		bm.deleteAll();
		bm.add(new Ball());

		dim.deleteAll();
		uim.setNoItem();

		_stage = ep.stages[_stageNum];
		for (let r = 0; r < ep.nRow; r++) {
			for (let c = 0; c < ep.nCol; c++) {
				if (_stage[r][c] <= 0) {
					svgm.hideBlock(r, c);
				} else {
					svgm.showBlock(r, c);
				}
			}
		}
		loader.loadStage(_stageNum, () => {
			_holding = true;
			lm.requestNext();
		});
	}


	/**ゲームループ
	 * @param {number} nowT requestAnimationFrameから与えられる値
	 */
	function _loop(nowT) {
		const dt = nowT - _beforeT;//[msec]
		_beforeT = nowT;
		lm.requestNext();
		if (_holding) {
			bm.gotoHead();//ballが1個だけの前提
			bm.nowNode.x = pad.x;
		} else {
			bm.gotoHead();
			while (bm.nowNode !== null) {
				_collision(bm.nowNode, bm.nowNode.vx * dt, bm.nowNode.vy * dt);
				bm.gotoNext();
			}
		}

		bm.sweep();
		bm.moveSvgAll();
		pad.recordBeforeX();
		pad.moveSvg();
		if (_holding) return;
		dim.collision(pad, dt);
		uim.tick(dt);

		//stage clear
		if (_nBreak * 100 / ep.nBlocks[_stageNum] >= ep.requirePercent) {
			lm.cancelNext();
			for (let r = 0; r < ep.nRow; r++) {
				for (let c = 0; c < ep.nCol; c++) {
					svgm.hideBlock(r, c);
				}
			}
			const gameClear = _stageNum >= ep.nStage - 1
			if (gameClear) {
				svgm.showGameClear();
				sm.callGameClearSe();
			} else {
				svgm.showStageClear();
				sm.callStageClearSe();
			}
			if (gameClear) {
				const target = document.getElementById("bb2021"); target.addEventListener("touchstart", moveToClearPage); target.addEventListener("click", moveToClearPage);
				function moveToClearPage() {
					window.top.location.href = ep.clearPageHref;
				}
			} else {
				setTimeout(
					() => { svgm.hideStageClear(); _initStage(); }
					, 2000);
			}
		}

		//fail
		if (bm.noBall) {
			lm.cancelNext();
			sm.callFailSe();
			if (_stock <= 0) {
				//gameover
				document.getElementById("bb_gameover").setAttribute("visibility", "visible");
			} else {
				_stock--;
				svgm.setStockText(_stock);
				svgm.showFailed();
				setTimeout(() => {
					svgm.hideFailed();
					_holding = true;
					bm.deleteAll();
					bm.add(new Ball());
					uim.setNoItem();
					lm.requestNext();
				}, 1000);
			}
		}
	}

	//TODO: 返り値があいまいなど要注意
	/**row行col列のブロックを1回たたく．
	 * ブロックのライフが0以下になったらブロックを見えなくする．
	 * @param {number} row 行
	 * @param {number} col 列
	 * @param {boolean} effectOn ブロック破壊エフェクトの有無
	 * @param {boolean} 叩けたらtrue*/
	function _hitBlock(row, col, effectOn) {
		if (_stage[row][col] <= 0) return false;
		_stage[row][col]--;
		if (_stage[row][col] <= 0) {
			svgm.hideBlock(row, col);
			_nBreak++;
			const blockW = 1 / ep.nCol;
			const blockH = ep.bBound / ep.nRow;
			dim.addNewItem(blockW * col + blockW / 2, blockH * row + blockH / 2);
			svgm.setPercentText(Math.floor(_nBreak * 100 / ep.nBlocks[_stageNum]));
			if (effectOn) svgm.svgBump();
		}
		return true;
	}

	/**ボールの衝突判定を行う
	 * 対象のボールballがvx,vy移動したときにブロックやパドル，壁と衝突するか
	 * 判定し，衝突するならば衝突時の処理を行う．ボールをvx,vyだけ進めたら終了する
	 * @param {Ball} ball 対象のボール
	 * @param {number} vx x方向移動距離
	 * @param {number} vy y方向移動距離*/
	function _collision(ball, vx, vy) {
		let minT = 10000;
		let hitInfo = "";
		function updateMinT(newT, newInfo) {
			if (newT < minT) {
				minT = newT;
				hitInfo = newInfo;
			}
		}

		// Bigballを使った時など壁に埋まったときの復旧
		if (ball.top < 0 && ball.vy < 0 && vy < 0) {
			ball.vy *= -1;
			vy *= -1;
		}
		if ((ball.left < 0 && ball.vx < 0 && vx < 0) ||
			(ball.right > 1 && ball.vx > 0 && vx > 0)) {
			ball.vx *= -1;
			vx *= -1;
		}

		//最初にぶつかる物体を求める．
		{//xDirection
			const l2r = vx > 0;
			const colBegin = l2r ?
				Math.ceil(ball.right * ep.nCol) :
				Math.floor(ball.left * ep.nCol - 1);
			const colEnd = l2r ?
				Math.floor((ball.right + vx) * ep.nCol) :
				Math.ceil((ball.left + vx) * ep.nCol - 1);
			const colInc = l2r ? +1 : -1;
			let col;
			function statL2R() { return col <= colEnd; }
			function statR2L() { return col >= colEnd; }
			const stat = l2r ?
				statL2R : statR2L;
			colOuter: for (col = colBegin; stat.call(); col += colInc) {
				const x = l2r ?
					col / ep.nCol - ball.xr :
					(col + 1) / ep.nCol + ball.xr;
				const y = interp1(ball.x, ball.y, ball.x + vx, ball.y + vy, x);
				if (0 <= col && col < ep.nCol) {
					//blocks
					const rowBegin = Math.floor((y - ball.yr) / ep.bBound * ep.nRow);
					const rowEnd = Math.floor((y + ball.yr) / ep.bBound * ep.nRow);
					if (rowBegin < 0) continue;//上のかべに埋まってる．
					//NOTE:ここらへんの条件ほんとにあってる？要確認．
					for (let row = rowBegin; row <= rowEnd; row++) {
						if (ep.nRow <= row) continue;
						if (_stage[row][col] > 0) {
							const t = dist(ball.x, ball.y, x, y);
							updateMinT(t, l2r ? "lBlock" : "rBlock");
							break colOuter;
						}
					}
				} else if (ball.yr < y && y < 1 - ball.yr) {
					//walls (col==-1 or col==ep.nCol)
					// 壁から出るなら阻害しない
					if ((l2r && col < 0) || (!l2r && ep.nCol <= col)) continue;
					const t = dist(ball.x, ball.y, x, y);
					updateMinT(t, l2r ? "r" : "l");
				}
			}
		}

		{//yDirection
			const t2b = vy > 0;
			const rowBegin = t2b ?
				Math.ceil(ball.bottom / ep.bBound * ep.nRow) :
				Math.floor(ball.top / ep.bBound * ep.nRow - 1);
			const rowEnd = t2b ?
				Math.floor((ball.bottom + vy) / ep.bBound * ep.nRow) :
				Math.ceil((ball.top + vy) / ep.bBound * ep.nRow - 1);
			const rowInc = t2b ? +1 : -1;
			let row;
			function statT2B() { return row <= rowEnd; }
			function statB2T() { return row >= rowEnd; }
			const stat = t2b ?
				statT2B : statB2T;
			rowOuter: for (row = rowBegin; stat.call(); row += rowInc) {
				const y = t2b ?
					row * ep.bBound / ep.nRow - ball.yr :
					(row + 1) * ep.bBound / ep.nRow + ball.yr;
				const x = interp1(ball.y, ball.x, ball.y + vy, ball.x + vx, y);
				if (0 <= row && row < ep.nRow) {
					//blocks
					const colBegin = Math.floor((x - ball.xr) * ep.nCol);
					const colEnd = Math.floor((x + ball.xr) * ep.nCol);
					if (colBegin < 0) continue;//左のかべに埋まってる．
					for (let col = colBegin; col <= colEnd; col++) {
						if (ep.nCol <= col) continue;
						if (_stage[row][col] > 0) {
							const t = dist(ball.x, ball.y, x, y);
							updateMinT(t, t2b ? "tBlock" : "bBlock");
							break rowOuter;
						}
					}
				} else if (row >= ep.nRow) {
					//There is no bottom wall.
					continue;
				} else if (ball.xr < x && x < 1 - ball.xr) {
					//row<=-1
					//Top wall
					if (t2b) continue;
					const t = dist(ball.x, ball.y, x, y);
					updateMinT(t, "t");
				}
			}
		}

		//pad
		if (vy > 0 && ball.bottom < pad.top && ball.bottom + vy > pad.top) {
			const hitY = pad.top - ball.yr;
			const hitX = interp1(ball.y, ball.x, ball.y + vy, ball.x + vx, hitY);
			if (pad.left - ball.xr < hitX && hitX < pad.right + ball.xr) {
				const t = dist(ball.x, ball.y, hitX, hitY);
				updateMinT(t, "pad");
			}
		}

		if (hitInfo === "" && vy > 0 && ball.bottom + vy > pad.top) {
			const l2r = vx > 0;//ball direction
			const a1 = l2r ? ball.right : ball.left;
			const a2 = a1 + vx;
			const b1 = l2r ? pad.beforeLeft : pad.beforeRight;
			const b2 = l2r ? pad.left : pad.right;
			if (Math.abs(a2 - a1 + b1 - b2) >= 0.0001) {
				const hitX = a1 + (a2 - a1) * (b1 - a1) / (a2 - a1 + b1 - b2);
				if ((a1 <= hitX && hitX <= a2) || (a2 <= hitX && hitX <= a1)) {
					const hitY = interp1(a1, ball.y, a2, ball.y + vy, hitX);
					if (pad.top - ball.yr <= hitY && hitY <= pad.bottom + ball.yr) {
						const t = dist(a1, ball.y, hitX, hitY);
						updateMinT(t, "padSide");
					}
				}
			}
		}


		if (hitInfo === "") {
			ball.x += vx;
			ball.y += vy;
			return;
		}
		const ratio1 = minT / length(vx, vy);
		const ratio2 = 1 - ratio1;
		ball.x += vx * ratio1;
		ball.y += vy * ratio1;
		let nextVx = vx * ratio2;
		let nextVy = vy * ratio2;
		if (hitInfo === "r" || hitInfo === "l" || hitInfo === "padSide") {
			if (hitInfo === "padSide") {
				pad.causeHitEffect();
				sm.callPadSe()
			} else {
				sm.callWallSe();
			}
			ball.vx *= -1;
			nextVx *= -1;
		} else if (hitInfo === "t") {
			ball.vy *= -1;
			nextVy *= -1;
			sm.callWallSe();
		} else if (hitInfo === "pad") {
			pad.causeHitEffect();
			if (Math.abs(ball.x - pad.x) <= pad.coreWidth / 2) {
				ball.mode = Ball.modeTypes.penetration;
				ball.vy *= -1;
				nextVy *= -1;
			} else {
				if (uim.usingItem.name !== PiercingItem.name) ball.mode = Ball.modeTypes.normal;
				const xAxis = (ball.x - pad.x) / ((pad.width / 2) + ball.xr) * Ball.AngleLim;
				//here,cos=y,attention
				const dy_x = - Math.cos(xAxis / 2 * Math.PI);
				const dx_x = Math.sin(xAxis / 2 * Math.PI);
				//y座標で長さ1ならばx座標では長さaspectRatio
				//x座標で長さ1ならばy座標では1/aspectRatio
				//ball.vyをx座標での長さに単位変換
				const ballV = length(ball.vx, y2x(ball.vy));
				const nextV = length(nextVx, nextVy);
				ball.vx = ballV * dx_x;
				ball.vy = ballV * x2y(dy_x);
				nextVx = nextV * dx_x;
				nextVy = nextV * x2y(dy_x);
			}
			ball.accelerate();
			sm.callPadSe();
		} else if (hitInfo === "lBlock" || hitInfo === "rBlock") {
			if (ball.mode !== Ball.modeTypes.penetration) {
				ball.vx *= -1;
				nextVx *= -1;
				sm.callWallSe();
			}
			const col = hitInfo === "lBlock" ?
				Math.round((ball.right) * ep.nCol) :
				Math.round((ball.left) * ep.nCol - 1);
			const rowBegin = Math.floor((ball.top) / ep.bBound * ep.nRow);
			const rowEnd = Math.floor((ball.bottom) / ep.bBound * ep.nRow);
			for (let row = rowBegin; row <= rowEnd; row++) {
				if (row >= ep.nRow) continue;
				if (_stage[row][col] > 0) {
					_hitBlock(row, col, ball.causeEffect());
				}
			}
		} else if (hitInfo === "tBlock" || hitInfo === "bBlock") {
			if (ball.mode !== Ball.modeTypes.penetration) {
				ball.vy *= -1;
				nextVy *= -1;
				sm.callWallSe();
			}
			const row = hitInfo === "tBlock" ?
				Math.round((ball.bottom) / ep.bBound * ep.nRow) :
				Math.round((ball.top) / ep.bBound * ep.nRow - 1);
			const colBegin = Math.floor((ball.left) * ep.nCol);
			const colEnd = Math.floor((ball.right) * ep.nCol);
			for (let col = colBegin; col <= colEnd; col++) {
				if (col >= ep.nCol) continue;
				if (_stage[row][col] > 0) {
					_hitBlock(row, col, ball.causeEffect());
				}
			}
		}
		else {
			throw new Error("hitInfo has wrong value. value:" + hitInfo);
		}
		_collision(ball, nextVx, nextVy);
	}

	return {
		initialize: _initialize,
		loop: _loop,
		hitBlock: _hitBlock,
		set holding(value) {
			if (_holding == value) return;
			_holding = value;
			if (!_holding) sm.callHoldoffSe();
		},
		get holding() { return _holding; },
		set stock(value) { _stock = value; },
		get stock() { return _stock; },
	}
})();




/**"loopManager"
 * requestAnimationFrameによるゲームループを管理するクラス．
 */
const lm = (function (loopFunc) {
	let _loopHandle;
	let _loop = loopFunc;
	return {
		requestNext() {
			_loopHandle = requestAnimationFrame(_loop);
		},
		cancelNext() { cancelAnimationFrame(_loopHandle); },
	}
})(game.loop);




//////////
// Util //
//////////
const interp1 = function (x1, y1, x2, y2, x) {
	const slope = (y2 - y1) / (x2 - x1);
	const inter = y1 - slope * x1;
	return slope * x + inter;
}

const length = function (x, y) {
	return Math.sqrt(x ** 2 + y ** 2);
}

const dist = function (x1, y1, x2, y2) {
	return Math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2);
}

const cointoss = function () {
	return Math.random() < 0.5;
}

/**クランプ処理を行う
 * @param {number} v 対象の値
 * @param {number} min
 * @param {number} max */
const clamp = function (v, min, max) {
	return Math.min(max, Math.max(min, v));
}

