// postMessageされたdataを解析する．
window.addEventListener("message", (e) => {
	const data = e.data;
	const method = data.method;
	switch (method) {
		case "setBallVelocityScale":
			if (data.parameter === undefined) { return; }
			api.setBallVelocityScale(data.parameter);
		default:
			break;
	}
})

const api = (function () {
	return {
		setBallVelocityScale(newValue) {
			Ball.vScale = newValue;
		}
	}
})();